import React, { Component } from 'react';
import AlluxioCluster from "./AlluxioCluster";
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Dataset from "../dataset/Dataset";

class AlluxioClusters extends Component {
    render() {
        const {alluxioList, handleSendRequest} = this.props

        // const numberOfAlluxio = alluxioListJSON.length
        // const alluxioElements = [];
        // for (let i = 0; i < numberOfAlluxio; i++) {
        //     alluxioElements.push(
        //         <AlluxioCluster key={i}
        //                  sequence={i}
        //                  originalJSON={alluxioListJSON[i]}
        //                  handleSendRequest={handleSendRequest}
        //         />
        //     );
        // }

        return (
            <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>Sequence Number</TableCell>
                            <TableCell align="left">Alluxio Cluster Name</TableCell>
                            <TableCell align="right">Phase</TableCell>
                            <TableCell align="right">Setting</TableCell>
                        </TableRow>
                    </TableHead>

                    <TableBody>
                        {alluxioList.map((originalJSON) => (
                            <AlluxioCluster
                                key={originalJSON['alluxio-cluster-config']['name']}
                                name={originalJSON['alluxio-cluster-config']['name']}
                                originalJSON={originalJSON}
                                handleSendRequest={handleSendRequest}
                            />
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        );
    }
}

export default AlluxioClusters;
